import React, { useState } from 'react';
import './Directory.css';
import MenuItem from '../menu-item/MenuItem';
import menuData from './menuData';
function Directory() {

    let [menuDataState, setMenuDataState] = useState(menuData)

    return (
        <div className="directory">
          {
              menuDataState.map(({ title, subTitle, imgUrl, id }) =>
               <MenuItem 
                    title={title}
                    subTitle={subTitle}
                    imgUrl={imgUrl}
                    key={id}
               />)
          }

        </div> 
    );
};

export default Directory;
